import React, { useEffect, useState } from "react";
import { Route, NavLink, useNavigate } from "react-router-dom";
import {
  TextField,
  Grid,
  Paper,
  Avatar,
  Button,
  FormControlLabel,
  Checkbox,
  Typography,
} from "@mui/material";
import AddCircleOutlineIcon from "@mui/icons-material/AddCircleOutline";
import { Link } from "react-router-dom";





export function SignUp() {
  let navigate = useNavigate();
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confPassword, setConfPassword] = useState("");
  const [phone, setPhone] = useState("");
  const [fromError, setFromError] = useState("");
  const [isSubmit, setIsSubmit] = useState(false);
   const [data ,setData] = useState("")
 
  const paperStyle = {
    padding: 20,
    height: "95vh",
    align: "center",
    width: 400,
    margin: "20px auto",
  };

  const handel = async (e) => {
    let obj = { name: name, email: email, password: password, phone: phone };
    setData(obj)
    console.log()
    e.preventDefault();
     setFromError(validate(obj))
     setIsSubmit(true)

    let result = await fetch("http://localhost:5000/api/accounts/register", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify(obj),
    });

    result = await result.json();
    if (result.status) navigate("/");

  };




  const validate = (values) => {
    console.log(values)
    const errors = {};
    const regex = /^[^\s@]+@[^\s@]+\.[^\s@]{2,}$/i;
    if (!name) {
      errors.username = "Username is required!";
    }
    if (!email) {
      errors.email = "Email is required!";
    } else if (!regex.test(values.email)) {
      errors.email = "This is not a valid email format!";
    }
    if (!password) {
      errors.password = "Password is required";
    } else if (password.length < 4) {
      errors.password = "Password must be more than 4 characters";
    } else if (password.length > 10) {
      errors.password = "Password cannot exceed more than 10 characters";
    }
    console.log(errors)
    return errors;
  };


  // useEffect(()=>{
  //   console.log(fromError)
  //   if(Object.keys(fromError).length === 0&& isSubmit){
  //     console.log(obj)
  //   }
  // })





  const avatarStyle = { backgroundColor: "#1bbd7e" };

  return (
    <div>

      <Grid>
        <Paper elevation={10} style={paperStyle}>
          <Grid align="center">
            <Avatar style={avatarStyle}>
              <AddCircleOutlineIcon />
            </Avatar>
          </Grid>
          <br />
          <h1 style={{ "text-align": "center" }}>Create Account</h1>
          <div style={{ width: 300, "padding-left": "50px" }}>
            <TextField
              variant="outlined"
              label="name"
              type="name"
              fullWidth
              value={name}
              onChange={(e) => {
                setName(e.target.value);
              }}
            />
            <p>{fromError}</p>
            <pre>{fromError.name}</pre>
            <br />
            <br />
            <TextField
              variant="outlined"
              label="Email"
              type="email"
              fullWidth
              value={email}
              onChange={(e) => {
                setEmail(e.target.value);
              }}
            />
            <br />
            <br />
            <TextField
              variant="outlined"
              label="Phone Number"
              type="text"
              pattern="[0-9]"
              fullWidth
              value={phone}
              onChange={(e) => {
                setPhone(e.target.value);
              }}
            />
            <br />
            <br />
            <TextField
              variant="filled"
              label="Password"
              type="password"
              fullWidth
              value={password}
              onChange={(e) => {
                setPassword(e.target.value);
              }}
            />
            <br />
            <br />
            <TextField
              variant="filled"
              label="ConformPassword"
              type="password"
              fullWidth
              value={confPassword}
              onChange={(e) => {
                setConfPassword(e.target.value);
              }}
            />
          </div>
          <FormControlLabel
            control={<Checkbox name="checkedB" color="primary" />}
            label="I am accepted term and condition"
          />
          <br />
          <br />
          <Button
            type="submit"
            color="primary"
            variant="contained"
            fullWidth
            onClick={handel}
          >
            Sign up
          </Button>
          <br />
          <br />
          <NavLink to="/">already account create</NavLink>
        </Paper>
      </Grid>
    </div>
  );
}
